    return (
      <MDBContainer>
        <MDBRow>1</MDBRow>
        <MDBRow>2</MDBRow>
        <MDBRow>3</MDBRow>
      </MDBContainer>
    );
  }
}

const mapStateToProps = (state) => ({});

